import React, { Component } from 'react'

export default class Dashboard extends Component {
  render() {
    return (
      <div  class="bg-primary mx-3 mt-3">
        <div class="row">
          <div class="col-2 bg-red">Col1</div>
          <div class="col-4">Col2</div>
        </div>
      </div>
    )
  }
}
